description:
With over 4 million installs and a 4.5+ ratings, PdaNet has become one of the must-have Android applications. This software shares your phone's Internet connection with your computer and does not require rooting your phone.
PdaNet adds zero latency to your connection so your computer connects as fast as your phone's Internet speed, such as 4G or even 100Mbps WiFi.
PdaNet supports both USB Tether or Bluetooth DUN, PC and Mac.
PdaNet also bundles a cool &quot;SMS Agent&quot; feature which allows you to send/receive SMS directly from your computer.
Free edition will limit secure web sites.

